<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>NHS Practice Finder</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            background-color: #f5f7fa;
            color: #333;
            line-height: 1.6;
        }

        .container {
            max-width: 1400px;
            margin: 0 auto;
            padding: 20px;
        }

        .header {
            background: linear-gradient(135deg, #00999E 0%, #007478 100%);
            color: white;
            padding: 30px 20px;
            border-radius: 12px;
            margin-bottom: 30px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .header h1 {
            font-size: 2.5em;
            margin-bottom: 10px;
            font-weight: 600;
        }

        .header p {
            font-size: 1.1em;
            opacity: 0.9;
        }

        .search-section {
            background: white;
            padding: 25px;
            border-radius: 12px;
            box-shadow: 0 2px 8px rgba(0, 0, 0, 0.08);
            margin-bottom: 30px;
        }

        .search-grid {
            display: grid;
            grid-template-columns: 1fr;
            gap: 15px;
        }

        @media (min-width: 768px) {
            .search-grid {
                grid-template-columns: 2fr 1fr 1fr;
            }
        }

        .input-group {
            position: relative;
        }

        .input-group label {
            display: block;
            font-weight: 500;
            margin-bottom: 5px;
            color: #555;
            font-size: 0.9em;
        }

        .input-group input,
        .input-group select {
            width: 100%;
            padding: 12px 15px;
            border: 2px solid #e1e8ed;
            border-radius: 8px;
            font-size: 16px;
            transition: all 0.3s ease;
            background-color: #fafbfc;
        }

        .input-group input:focus,
        .input-group select:focus {
            outline: none;
            border-color: #00999E;
            background-color: white;
            box-shadow: 0 0 0 3px rgba(0, 153, 158, 0.1);
        }

        .stats-bar {
            background: #f0f4f8;
            padding: 15px 20px;
            border-radius: 8px;
            margin-bottom: 20px;
            display: flex;
            justify-content: space-between;
            align-items: center;
            flex-wrap: wrap;
            gap: 10px;
        }

        .stat-item {
            display: flex;
            align-items: center;
            gap: 8px;
        }

        .stat-number {
            font-weight: 600;
            color: #00999E;
            font-size: 1.2em;
        }

        .clear-filters {
            background: #dc3545;
            color: white;
            border: none;
            padding: 8px 16px;
            border-radius: 6px;
            cursor: pointer;
            font-size: 0.9em;
            transition: all 0.3s ease;
        }

        .clear-filters:hover {
            background: #c82333;
            transform: translateY(-1px);
        }

        .results-container {
            background: white;
            border-radius: 12px;
            box-shadow: 0 2px 8px rgba(0, 0, 0, 0.08);
            overflow: hidden;
        }

        .results-header {
            background: #f8f9fa;
            padding: 15px 20px;
            border-bottom: 1px solid #dee2e6;
            font-weight: 500;
        }

        .results-list {
            max-height: 600px;
            overflow-y: auto;
        }

        .practice-card {
            padding: 20px;
            border-bottom: 1px solid #e9ecef;
            transition: all 0.3s ease;
            cursor: pointer;
        }

        .practice-card:hover {
            background: #f8f9fa;
            transform: translateX(5px);
        }

        .practice-name {
            font-size: 1.1em;
            font-weight: 600;
            color: #00999E;
            margin-bottom: 8px;
        }

        .practice-details {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
            gap: 10px;
            font-size: 0.9em;
        }

        .detail-item {
            display: flex;
            gap: 5px;
        }

        .detail-label {
            font-weight: 500;
            color: #666;
        }

        .detail-value {
            color: #333;
        }

        .no-results {
            text-align: center;
            padding: 40px;
            color: #666;
        }

        .load-more {
            display: block;
            width: 200px;
            margin: 20px auto;
            padding: 12px 24px;
            background: #00999E;
            color: white;
            border: none;
            border-radius: 8px;
            font-size: 1em;
            cursor: pointer;
            transition: all 0.3s ease;
        }

        .load-more:hover {
            background: #007478;
            transform: translateY(-2px);
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.15);
        }

        .autocomplete-suggestions {
            position: absolute;
            top: 100%;
            left: 0;
            right: 0;
            background: white;
            border: 1px solid #ddd;
            border-radius: 0 0 8px 8px;
            max-height: 200px;
            overflow-y: auto;
            z-index: 1000;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .suggestion-item {
            padding: 10px 15px;
            cursor: pointer;
            transition: background 0.2s;
        }

        .suggestion-item:hover {
            background: #f0f4f8;
        }

        .suggestion-highlight {
            font-weight: 600;
            color: #00999E;
        }

        .results-list::-webkit-scrollbar {
            width: 8px;
        }

        .results-list::-webkit-scrollbar-track {
            background: #f1f1f1;
        }

        .results-list::-webkit-scrollbar-thumb {
            background: #888;
            border-radius: 4px;
        }

        .results-list::-webkit-scrollbar-thumb:hover {
            background: #555;
        }

        .export-btn {
            background: #28a745;
            color: white;
            border: none;
            padding: 8px 16px;
            border-radius: 6px;
            cursor: pointer;
            font-size: 0.9em;
            transition: all 0.3s ease;
            margin-left: 10px;
        }

        .export-btn:hover {
            background: #218838;
            transform: translateY(-1px);
        }
    </style>
</head>
<body>
    <div class="container">
        <div class="header">
            <h1>NHS Practice Finder</h1>
            <p>Search and explore GP practices across England</p>
        </div>

        <div class="search-section">
            <div class="search-grid">
                <div class="input-group">
                    <label for="searchInput">Search by practice name or code</label>
                    <input 
                        type="text" 
                        id="searchInput" 
                        placeholder="Enter practice name or code..."
                        autocomplete="off"
                    >
                    <div id="autocomplete" class="autocomplete-suggestions" style="display: none;"></div>
                </div>
                <div class="input-group">
                    <label for="regionFilter">Region</label>
                    <select id="regionFilter">
                        <option value="">All Regions</option>
                    </select>
                </div>
                <div class="input-group">
                    <label for="icbFilter">ICB</label>
                    <select id="icbFilter">
                        <option value="">All ICBs</option>
                    </select>
                </div>
            </div>
        </div>

        <div class="stats-bar">
            <div class="stat-item">
                <span>Showing:</span>
                <span class="stat-number" id="showingCount">0</span>
                <span>of</span>
                <span class="stat-number" id="totalCount">0</span>
                <span>practices</span>
            </div>
            <div>
                <button class="export-btn" id="exportBtn" onclick="exportResults()">
                    Export Results
                </button>
                <button class="clear-filters" id="clearFilters" style="display: none;">
                    Clear Filters
                </button>
            </div>
        </div>

        <div class="results-container">
            <div class="results-header">
                Search Results
            </div>
            <div id="resultsArea" class="results-list"></div>
        </div>
    </div>

              "PCN Adjusted Population I January 25 updated": ""
            },
            {
              "Practice code": "",
              "Practice name": "",
              "PCN Code Jan 25": "",
              "PCN Name Jan 25": "",
              "ICB of practice name": "",
              "Region": "",
              "Raw list size from GSUM 1 January 25": "",
              "PCN Adjusted Population I January 25 updated": ""
            },
            {
              "Practice code": "",
              "Practice name": "",
              "PCN Code Jan 25": "",
              "PCN Name Jan 25": "",

              "Region": "",
              "Raw list size from GSUM 1 January 25": "",
              "PCN Adjusted Population I January 25 updated": ""
            },
            {
              "Practice code": "",
              "Practice name": "",
              "PCN Code Jan 25": "",
              "PCN Name Jan 25": "",

              "Region": "",

              "PCN Adjusted Population I January 25 updated": ""
            },
            {
              "Practice code": "",
              "Practice name": "",
              "PCN Code Jan 25": "",
              "PCN Name Jan 25": "",

              "Region": "",

              "PCN Adjusted Population I January 25 updated": ""
            },
            {
              "Practice code": "",
              "Practice name": "",
              "PCN Code Jan 25": "",
              "PCN Name Jan 25": "",
              "ICB of practice name": "",
              "Region": "",
              "Raw list size from GSUM 1 January 25": "",
              "PCN Adjusted Population I January 25 updated": ""
            }
          ];

        // Global variables
        let filteredData = [];
        let displayedCount = 0;
        const BATCH_SIZE = 50;

        // Initialize when page loads
        document.addEventListener('DOMContentLoaded', function() {
            initializeApp();
        });

        function initializeApp() {
            // Check if data was loaded
            if (practicesData.length === 0) {
                document.getElementById('resultsArea').innerHTML = `
                    <div class="no-results">
                        <h3>No Data Loaded</h3>
                        <p>Please paste your JSON data in the script section where it says "PASTE YOUR JSON DATA HERE"</p>
                    </div>
                `;
                return;
            }

            filteredData = practicesData;
            populateFilters();
            filterAndDisplay();
            document.getElementById('totalCount').textContent = practicesData.length;
            setupEventListeners();
        }

        function setupEventListeners() {
            const searchInput = document.getElementById('searchInput');
            const regionFilter = document.getElementById('regionFilter');
            const icbFilter = document.getElementById('icbFilter');
            const clearButton = document.getElementById('clearFilters');

            let searchTimeout;
            searchInput.addEventListener('input', function(e) {
                clearTimeout(searchTimeout);
                searchTimeout = setTimeout(() => {
                    filterAndDisplay();
                }, 300);
                
                if (e.target.value.length >= 2) {
                    showAutocomplete(e.target.value);
                } else {
                    document.getElementById('autocomplete').style.display = 'none';
                }
            });

            regionFilter.addEventListener('change', filterAndDisplay);
            icbFilter.addEventListener('change', filterAndDisplay);

            clearButton.addEventListener('click', function() {
                searchInput.value = '';
                regionFilter.value = '';
                icbFilter.value = '';
                filterAndDisplay();
            });

            searchInput.addEventListener('blur', function() {
                setTimeout(() => {
                    document.getElementById('autocomplete').style.display = 'none';
                }, 200);
            });

            const resultsContainer = document.querySelector('.results-list');
            resultsContainer.addEventListener('scroll', function() {
                if (resultsContainer.scrollTop + resultsContainer.clientHeight >= 
                    resultsContainer.scrollHeight - 100) {
                    if (displayedCount < filteredData.length) {
                        displayResults();
                    }
                }
            });
        }

        function filterAndDisplay() {
            const searchTerm = document.getElementById('searchInput').value.toLowerCase();
            const selectedRegion = document.getElementById('regionFilter').value;
            const selectedICB = document.getElementById('icbFilter').value;

            filteredData = practicesData.filter(practice => {
                const matchesSearch = !searchTerm || 
                    (practice.name && practice.name.toLowerCase().includes(searchTerm)) ||
                    (practice.code && practice.code.toLowerCase().includes(searchTerm)) ||
                    (practice.pcnName && practice.pcnName.toLowerCase().includes(searchTerm)) ||
                    (practice['Practice name'] && practice['Practice name'].toLowerCase().includes(searchTerm)) ||
                    (practice['Practice code'] && practice['Practice code'].toLowerCase().includes(searchTerm));

                const practiceRegion = practice.region || practice['Region'];
                const practiceICB = practice.icb || practice['ICB of practice name'];
                
                const matchesRegion = !selectedRegion || practiceRegion === selectedRegion;
                const matchesICB = !selectedICB || practiceICB === selectedICB;

                return matchesSearch && matchesRegion && matchesICB;
            });

            updateStats();
            displayedCount = 0;
            displayResults(true);

            const hasFilters = searchTerm || selectedRegion || selectedICB;
            document.getElementById('clearFilters').style.display = hasFilters ? 'inline-block' : 'none';
        }

        function displayResults(reset = false) {
            const resultsArea = document.getElementById('resultsArea');
            
            if (reset) {
                resultsArea.innerHTML = '';
            }

            if (filteredData.length === 0) {
                resultsArea.innerHTML = '<div class="no-results"><h3>No practices found</h3><p>Try adjusting your search criteria</p></div>';
                return;
            }

            const start = displayedCount;
            const end = Math.min(displayedCount + BATCH_SIZE, filteredData.length);
            
            for (let i = start; i < end; i++) {
                const practice = filteredData[i];
                const card = createPracticeCard(practice);
                resultsArea.appendChild(card);
            }

            displayedCount = end;

            if (displayedCount < filteredData.length) {
                const existingButton = resultsArea.querySelector('.load-more');
                if (!existingButton) {
                    const loadMoreBtn = document.createElement('button');
                    loadMoreBtn.className = 'load-more';
                    loadMoreBtn.textContent = 'Load More Results';
                    loadMoreBtn.onclick = () => {
                        loadMoreBtn.remove();
                        displayResults();
                    };
                    resultsArea.appendChild(loadMoreBtn);
                }
            }

            updateStats();
        }

        function createPracticeCard(practice) {
            const card = document.createElement('div');
            card.className = 'practice-card';
            
            // Handle both possible data formats
            const name = practice.name || practice['Practice name'] || '';
            const code = practice.code || practice['Practice code'] || '';
            const pcnName = practice.pcnName || practice['PCN Name Jan 25'] || '';
            const pcnCode = practice.pcnCode || practice['PCN Code Jan 25'] || '';
            const icb = practice.icb || practice['ICB of practice name'] || '';
            const region = practice.region || practice['Region'] || '';
            const listSize = practice.listSize || practice['Raw list size from GSUM 1 January 25'] || '';
            const adjustedPop = practice.adjustedPop || practice['PCN Adjusted Population I January 25 updated'] || '';
            
            card.innerHTML = `
                <div class="practice-name">${name}</div>
                <div class="practice-details">
                    <div class="detail-item">
                        <span class="detail-label">Code:</span>
                        <span class="detail-value">${code}</span>
                    </div>
                    <div class="detail-item">
                        <span class="detail-label">PCN:</span>
                        <span class="detail-value">${pcnName}</span>
                    </div>
                    <div class="detail-item">
                        <span class="detail-label">ICB:</span>
                        <span class="detail-value">${icb}</span>
                    </div>
                    <div class="detail-item">
                        <span class="detail-label">Region:</span>
                        <span class="detail-value">${region}</span>
                    </div>
                    <div class="detail-item">
                        <span class="detail-label">List Size:</span>
                        <span class="detail-value">${listSize}</span>
                    </div>
                    <div class="detail-item">
                        <span class="detail-label">Adjusted Population:</span>
                        <span class="detail-value">${adjustedPop}</span>
                    </div>
                </div>
            `;
            return card;
        }

        function updateStats() {
            document.getElementById('showingCount').textContent = displayedCount;
            document.getElementById('totalCount').textContent = filteredData.length;
        }

        function populateFilters() {
            // Get unique regions and ICBs - handle both data formats
            const regions = [...new Set(practicesData.map(p => p.region || p['Region']).filter(Boolean))].sort();
            const icbs = [...new Set(practicesData.map(p => p.icb || p['ICB of practice name']).filter(Boolean))].sort();

            const regionSelect = document.getElementById('regionFilter');
            regionSelect.innerHTML = '<option value="">All Regions</option>';
            regions.forEach(region => {
                const option = document.createElement('option');
                option.value = region;
                option.textContent = region;
                regionSelect.appendChild(option);
            });

            const icbSelect = document.getElementById('icbFilter');
            icbSelect.innerHTML = '<option value="">All ICBs</option>';
            icbs.forEach(icb => {
                const option = document.createElement('option');
                option.value = icb;
                option.textContent = icb.length > 50 ? icb.substring(0, 50) + '...' : icb;
                option.title = icb;
                icbSelect.appendChild(option);
            });
        }

        function showAutocomplete(searchTerm) {
            const suggestions = practicesData
                .filter(p => {
                    const name = p.name || p['Practice name'] || '';
                    const code = p.code || p['Practice code'] || '';
                    return name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                           code.toLowerCase().includes(searchTerm.toLowerCase());
                })
                .slice(0, 5);

            const autocompleteDiv = document.getElementById('autocomplete');
            if (suggestions.length > 0) {
                autocompleteDiv.innerHTML = suggestions.map(p => {
                    const name = p.name || p['Practice name'] || '';
                    const code = p.code || p['Practice code'] || '';
                    return `
                        <div class="suggestion-item" onclick="selectSuggestion('${code}')">
                            <span class="suggestion-highlight">${name}</span>
                            <span style="color: #666; font-size: 0.9em;"> - ${code}</span>
                        </div>
                    `;
                }).join('');
                autocompleteDiv.style.display = 'block';
            } else {
                autocompleteDiv.style.display = 'none';
            }
        }

        function selectSuggestion(code) {
            const practice = practicesData.find(p => 
                (p.code || p['Practice code']) === code
            );
            if (practice) {
                document.getElementById('searchInput').value = practice.name || practice['Practice name'] || '';
                document.getElementById('autocomplete').style.display = 'none';
                filterAndDisplay();
            }
        }

        function exportResults() {
            const csvContent = [
                ['Practice Code', 'Practice Name', 'PCN Code', 'PCN Name', 'ICB', 'Region', 'List Size', 'Adjusted Population'],
                ...filteredData.map(p => [
                    p.code || p['Practice code'] || '',
                    p.name || p['Practice name'] || '',
                    p.pcnCode || p['PCN Code Jan 25'] || '',
                    p.pcnName || p['PCN Name Jan 25'] || '',
                    p.icb || p['ICB of practice name'] || '',
                    p.region || p['Region'] || '',
                    p.listSize || p['Raw list size from GSUM 1 January 25'] || '',
                    p.adjustedPop || p['PCN Adjusted Population I January 25 updated'] || ''
                ])
            ].map(row => row.map(cell => `"${cell}"`).join(',')).join('\n');

            const blob = new Blob([csvContent], { type: 'text/csv' });
            const url = URL.createObjectURL(blob);
            const a = document.createElement('a');
            a.href = url;
            a.download = `nhs-practices-${new Date().toISOString().split('T')[0]}.csv`;
            document.body.appendChild(a);
            a.click();
            document.body.removeChild(a);
            URL.revokeObjectURL(url);
        }
    </script>
